(1, 'Пицца на сверхтонком тесте', 1000, 'Классическое тесто для пиццы делается из специальной муки (Farina Di Grano Tenero, tipo 00), натуральных дрожжей[5] (закваски), соли и воды. Тесто замешивается вручную и отправляется на двухчасовой отдых, после этого его делят на шарики и отправляют на длительный отдых — около 8 часов. Руками из шарика формируется основа для пиццы, тесто покрывается томатным соусом либо его аналогами. После этого возможно добавление практически любых начинок. Классическая пицца выпекается в специальной дровяной печи, которая называется помпейской и имеет форму свода в виде полусферы. Также существуют подовые и конвейерные печи для выпекания пиццы. В дровяных печах огонь разводится с одной из сторон; жар от него, поднимаясь вверх, попадает в фокус сферы и отражается в центр печи на середину пода, нагревая его. В связи с этим пицца в такой печи готовится около 90 секунд, а в домашних условиях — в предварительно разогретой до 250-275 °C духовке от 8 до 10 минут.', 1, 1, 'img/pizza.jpg'),
(2, 'Равиоли со сметаной', 500, 'Изготавливаются равиоли из пресного теста в виде полумесяца, эллипса или квадрата с фигурным обрезом края. Затем могут либо отвариваться, либо обжариваться в масле, во втором случае их подают к бульонам или супам. Начинка может быть мясной, рыбной, из птицы, овощей или фруктов.', 2, 1, 'img/ravioli.jpg');
