(94, 90, 'A, D', 'A) остутсвует условие остановки где-либо\r\n\r\nD) Прибавление происходит только пока i < 99. Когда i становится 99 оператор continue пытается прибавить счетчик силами for но там не опеределно прибавление счетчика - бесконечный.\r\n\r\nb) условие остановки 0 значит false, сразу выходим\r\n\r\nc) при i == 99 произойдет break и цикл закончится\r\n\r\ne, f) Задачи на переполнение записанные немного по-разному. Цикл будет прибавлять и в какой-то момент переполнит тип short, из-за чего мы попадем в отрицательные значения. После этого мы рано или поздно дойдем до 0. Разница лишь в записи условия. В f) i++ вернёт 0, когда i станет равным 1, а в e) выход произойдет на i=0, потому что счетчик прибавляется до проверки условия.', 1),
