(205, 170, '-', 'Фундаментальные физические взаимодействия. В настоящее время известны четыре типа фундаментальных взаимодействий между элементарными частицами: сильное, электромагнитное, слабое, гравитационное.', 0),
(206, 171, '-', 'Сильные взаимодействия — взаимодействия между нуклонами и другими тяжелыми частицами. Они обеспечивают, стабильность ядер и отвечают за процессы рождения частиц при взаимодействии частиц высоких энергий. Это весьма короткодействующие взаимодействия: они проявляются лишь в пределах ядра, т. е. на расстояниях, не превышающих 10-16 м.\r\nСлабые взаимодействия, наблюдаемые главным образом на расстояниях, не превышающих 10-13 м, определяют бета-распад. \r\nЭлектромагнитные взаимодействия проявляются на любых расстояниях и определяют практически все свойства атомов, молекул и макроскопических тел. \r\nГравитационное взаимодействие, присущее всем без исключения частицам на любых расстояниях, практически не проявляется на атомных расстояниях вследствие своей относительной слабости. Но при увеличении массы объекта это взаимодействие начинает играть основную роль, например, для незаряженных макроскопических тел.\r\nЭлектромагнитные используются в оптике.', 0),
(207, 172, '-', 'Потому, что в природе существуют еще гравитационное взаимодействие, которое никак не связано с электрослабым взаимодействием (электромагнитное и слабое взаимодействие являются проявлениями единого электрослабого взаимодействия) , а связано с искривлением пространства, а также, существует еще сильное (его еще называют цветовое или ядерное) взаимодействие, которое отвечает за притяжение между нуклонами в ядрах.', 0),
(209, 173, '-', 'Размерность физической величины — выражение, показывающее, во сколько раз изменится единица физической величины при изменении единиц величин, принятых в данной системе за основные. Размернось представляет собой одночлен, составленный из произведения обобщённых символов основных единиц в различных (целых или дробных, положительных или отрицательных) степенях, которые называются показателями размерности. Так, например, размерность скорости L/T или LT^-1, где Т представляет собой размерность времени, а L — длины. Эти символы обозначают единицы времени и длины независимо от их конкретного размера (секунда, минута, час, метр, сантиметр и т. д. )\r\n\r\nТаким образом, размерность неизменна (для массы всегда M, а вот единица варьируется - килограммы, тонны, центнеры, унции, караты).', 0),
(210, 174, '-', 'Оосновные(7) - секунда, метр, кг, ампер(А), кельвин(К), моль, кандела(кд)\r\n\r\nДополнительные(2) - радианы(рад), стерадиан(ср)', 0),
(211, 175, '-', '101 дека deca да da дал—декалитр\r\n102 гекто hecto	г h гПа—гектопаскаль\r\n103 кило kilo к k кН—килоньютон\r\n106 мега mega М M МПа—мегапаскаль\r\n109 гига giga Г G ГГц—гигагерц\r\n1012 тера tera Т T ТВ—теравольт\r\n1015 пета peta П P Пфлопс—петафлопс\r\n1018 экса exa Э E Эм—эксаметр\r\n1021 зетта zetta З Z ЗэВ—зеттаэлектронвольт\r\n1024 иотта yotta И Y Иг—иоттаграмм', 0),
(212, 176, '-', '10−1 деци deci д d дм—дециметр\r\n10−2 санти centi с c см—сантиметр\r\n10−3 милли milli м m мH—миллиньютон\r\n10−6 микро micro мк µ мкм—микрометр\r\n10−9 нано nano н n нм—нанометр\r\n10−12 пико pico п p пФ—пикофарад\r\n10−15 фемто femto ф f фл—фемтолитр\r\n10−18 атто atto а a ас—аттосекунда\r\n10−21 зепто zepto з z зКл—зептокулон\r\n10−24 иокто yocto и y иг—иоктограмм', 0),
(213, 177, '-', 'Метод размерностей – одно из самых интересных методов расчета. Суть его заключается в возможности восстанавливать различные соотношения между физическими величинами. Достоинства: быстрая оценка масштабов исследуемых явлений; получение качественных и функциональных зависимостей; восстановление забытых формул', 0),
(214, 178, '-', '1. Постулат однородности времени, утверждает, что перенос начала\r\nотсчета времени никак не влияет на физические процессы.\r\nСледствием этого постулата является закон сохранения энергии.\r\n2. Постулат однородности пространства, утверждает, что перенос\r\nначала координат не влияет на физические процессы. Следствием\r\nэтого постулата является закон сохранения импульса.\r\n3. Постулат изотропии пространства, утверждает, что поворот\r\nсистемы координат в пространстве не влияет на физические\r\nпроцессы. Следствием этого постулата является закон сохранения\r\nмомента импульса.\r\n4. Постулат постоянства скорости света. (Следуя Пуанкаре можно\r\nсказать, что без этого постулата нельзя синхронизировать часы\r\nдаже в одной и той же системе координат).\r\n5. Принцип относительности, утверждает, что все физические\r\nпроцессы выглядят одинаково во всех инерциальных системах\r\nотсчета (при одинаковых начальных условиях).\r\n6. Принцип наименьшего действия, утверждает, что для любой\r\nфизической системы существует величина, называемая действием,\r\nкоторая для реального физического процесса достигает минимума\r\n(в общем случае экстремума).\r\nПо существу это интегральный принцип, система как бы\r\nпрощупывает возможные действия от начала до самого конца, при\r\nэтом возникает кажущаяся противоречивость с\r\nдифференциальными принципами движения. Долгое время этот\r\nпринцип использовался теологами в качестве обоснования\r\nсуществования бога.\r\n7. Принцип «деградации» энергии, утверждает, что в\r\nтермодинамических системах всегда имеется тенденция\r\nпревращения упорядоченных форм движения в хаотические формы\r\nдвижения (принцип возрастания энтропии).\r\n8. Постулат равенства действия и противодействия (третий закон\r\nНьютона).\r\n9. Постулат инвариантности заряда.\r\n10. Принцип корпускулярно-волнового дуализма, согласно\r\nкоторому все микроскопические объекты обладают свойствами, как\r\nчастиц, так и волн.\r\n11. Принцип неопределенности, согласно которому существуют пары\r\nфизических величин, которые не могут быть одновременно\r\nизмерены точно. Например, координаты и скорость частиц.\r\n12. Принцип андетерминизма, утверждает, что в микроскопических и\r\nв некоторых макроскопических системах не работают жесткие\r\nдетерминистические схемы.', 0),
(215, 179, '-', 'Вроде как да', 0),
(216, 180, '-', 'В задаче говорится только про скорость, но не говорится про траекторию движения автомобиля. Если автомобиль движется по траектории отличной от прямой, то при постоянном значении скорости центростремительное укорение не будет равно нулю.', 0),
(217, 181, '-', 'Наименьшая скорость снаряда будет в наивысшей точке траектории, так как в этой точке вертикальная составляющая скорости (vy) равна нулю и скорость определяется только горизонтальной составляющей (vк), которая одинакова во всех точках траектории.', 0),
(218, 182, '-', 'Вообще-то равнопеременным движением называется равноускоренное движение - т. е. движение с постоянным по величине и направлению ускорением. Движение с постоянным по величине ускорением необязательно равноускоренное (равнопеременное) , т. к. ускорение в этом случае может менять свое направление, не меняя величины.', 0),
(219, 184, '-', 'Только по траектории уравнение движения тела восстановить нельзя. Обязательно требуются данные или по времени, или по скорости, или по их производным.', 0),
(220, 185, '-', 'могут, угол изменяться может в пределах от нуля (когда скорость и ускорение сонаправлены ) до 2пи (когда они противоположны направлены ).', 0),
(221, 186, '-', 'Легко найти связь между линейной скоростью точки v, ее угловой скоростью ω и радиусом r окружности, по которой она движется.\r\n\r\nт. е. линейная скорость при движении по окружности равна угловой скорости, умноженной на радиус окружности.\r\n\r\nПри вращательном движении действуют: тангенциальное и центростремительное ускорения.\r\n\r\nВ любой точке вращательного движения шара вектор его линейной скорости направлен перпендикулярно радиусу. Нетрудно догадаться, что при таком вращении по окружности, вектор линейной скорости шара постоянно меняет свое направление. Ускорение, характеризующее такое изменение скорости, называется центробежным (центростремительным) ускорением.Существует связь между тангенциальным и угловым ускорениями:\r\n\r\nat = a*R\r\n\r\nгде R — радиус кривизны траектории точки в данный момент времени\r\n\r\nТангенциальное ускорение направлено по касательной в траектории движения тела, а нормальное — перпендикулярно ему.', 0),
(222, 187, '-', 'Сложение скоростей — с помощью данного закона определяется скорость движения тела относительно неподвижной системы отсчёта. Она равна векторной сумме скорости этого тела относительно подвижной системы отсчета и скорости самой подвижной системы отсчета относительно неподвижной системы.', 0),
(223, 188, '-', 'Преобразова́ния Галиле́я — в классической механике (механике Ньютона) преобразования координат и времени при переходе от одной инерциальной системы отсчета (ИСО) к другой. Термин был предложен Филиппом Франком в 1909 году. Преобразования Галилея подразумевают одинаковость времени во всех системах отсчета («абсолютное время») и выполнение принципа относительности .', 0),
(224, 189, '-', 'Инерция-ЯВЛЕНИЕ СОХРАНЕНИЯ состояния движения или покоя при отсутствии внешних воздействий. а инертность это ФИЗИЧЕСКОЕ СВОЙСТВО тела характеризующее его способность ИЗМЕНЯТЬ скорость как по модулю,так и по направлению.', 0),
(225, 190, '-', 'Первый закон Ньютона постулирует существование инерциальных систем отсчёта. Поэтому он также известен как закон инерции. Инерция (она же инертность[3]) — свойство тела сохранять скорость своего движения неизменной по величине и направлению, когда не действуют никакие силы, а также свойство тела сопротивляться изменению его скорости. Чтобы изменить скорость движения тела, необходимо приложить некоторую силу, причём результат действия одной и той же силы на разные тела будет различным: тела обладают разной инерцией (инертностью), величина которой характеризуется их массой.\r\nСуществуют такие системы отсчёта, называемые инерциальными, относительно которых материальные точки, когда на них не действуют никакие силы (или действуют силы взаимно уравновешенные), находятся в состоянии покоя или равномерного прямолинейного движения.', 0),
(226, 191, '-', 'Вроде и так, и так, но наверное оригинальная - первая.', 0),
(227, 192, '-', 'Инертность — это свойство, присущее всем телам. Масса тела — количественная мера его инертности. О теле, которое в результате взаимодействия меньше изменяет свою скорость, говорят, что оно более инертно, масса его больше: В СИ единицей массы тела является килограмм (кг).', 0),
(228, 193, '-', 'Вес — сила, с которой тело действует на опору (или подвес, или другой вид крепления), препятствующую падению, возникающая в поле сил тяжести. Единица измерения веса в Международной системе единиц (СИ) — ньютон, иногда используется единица СГС — дина.', 0),
(229, 194, '-', 'В однородном силовом поле материальная точка движется с постоянным ускорением. Траекторией движения точки является ветвь параболы', 0),
(230, 195, '-', 'Установка представляла собой деревянное коромысло длиной около 1,8 м с прикреплёнными к его концам небольшими свинцовыми шарами диаметром 5 см и массой 11 262 грана (0,7298 кг), подвешенное на нити из посеребрённой меди длиной 1 м. К этим шарам с помощью специальной поворотной фермы, ось вращения которой совпадает насколько возможно точно с осью нити, подводились два свинцовых шара бо́льшего размера — диаметром 12 дюймов (около 30 см) и массой 2 439 000 гран (158 кг), жёстко закреплённые на ферме, таким образом, что расстояние между центрами большого и малого шара составляло около 8,85 дюйма (22,5 см). Вследствие гравитационного взаимодействия малых шаров с большими коромысло отклонялось на некоторый угол. Зная упругие свойства нити, а также угол поворота коромысла, можно вычислить силу притяжения малого шара к большому, а отсюда и гравитационную постоянную.\r\n\r\nУпругость нити на кручение определялась, исходя из периода свободных колебаний коромысла, который составлял в разных вариантах эксперимента 14—15 или 7 минут.\r\n\r\nПоскольку измеряемые силы ничтожно малы (около 0,17 микроньютона, что примерно в 50 млн раз меньше веса малого шара)[2], Кавендиш предпринял целый ряд мер с целью компенсации систематических погрешностей, возникающих вследствие воздействия физических условий опыта, которые не имели непосредственного отношения к измеряемым гравитационным силам, но могли оказать на результат влияние, сравнимое или даже превышающее действие этих сил. В числе этих мер можно отметить следующие.\r\n\r\nОпыт проводится в два приёма: сначала большие шары с помощью поворотного механизма фермы подводятся к малым с одной стороны (например, против часовой стрелки, как показано на рисунке), а затем — с противоположной, и измеряется двойной угол закручивания нити — от отклонения коромысла в одном направлении до противоположного. Это увеличивает непосредственно измеряемое значение угла, а главное — компенсирует влияние возможного наклонения или деформации установки и/или здания при перемещении тяжёлых шаров в ходе эксперимента, а также воздействие на результат всевозможных асимметричных факторов: технически неизбежной асимметрии самой установки, гравитационного влияния массивных объектов, находящихся поблизости (зданий, гор и т. п.), магнитного поля Земли, её вращения, положения Солнца и Луны, и др.\r\nДля предотвращения влияния конвекционных потоков воздуха в помещении крутильные весы были заключены в деревянный кожух.\r\nПредположив, что на закручивание нити может оказать влияние магнитное взаимодействие железных стержней фермы и свинцовых шаров, Кавендиш заменил стержни медными, получив те же результаты.', 0),
(231, 196, '-', 'Первый закон Кеплера. Каждая планета движется по эллипсу, в одном из фокусов которого находится Солнце.\r\n\r\nВторой закон Кеплера (закон равных площадей). Радиус-вектор планеты за равные промежутки времени описывает равновеликие площади. Другая формулировка этого закона: секториальная скорость планеты постоянна.\r\n\r\nТретий закон Кеплера. Квадраты периодов обращений планет вокруг Солнца пропорциональны кубам больших полуосей их эллиптических орбит.', 0),
(232, 197, '-', 'Могут, если они вращаються вокруг разных тел. Т. е. если они в разных системах.\r\n(А ТАК НЕТ)', 0),
(233, 198, '-', 'Чем дальше от центра, тем меньше скорость\r\nv=√GM/R\r\nR-расстояние от центра', 0),
(234, 199, '-', 'Для кругового движения скорость спутника всегда перпендикулярна действующей на него силе притяжения и вычисляется исходя из того, что сила гравитационного притяжения GMm/r2 равна центростремительной силе mv2/r, где М — масса Земли, m — масса спутника, r — радиус орбиты, v — скорость спутника.', 0),
(235, 200, '-', 'Центробежная сила инерции  F = m*w^2*R\r\nСила Кориолиса F = 2*m[v\', w]\r\nВторой закон Ньютона F = am', 0),
(236, 201, '-', 'В северном полушарии сила Кориолиса направлена вправо под прямым углом к движению тела, а в южном - влево. Под ее действием на реках северного полушария частицы воды отклоняются к правому берегу и создают превышение уровня воды у правого берега по сравнению с левым, а в южном - наоборот.', 0),
(237, 202, '-', 'Неа, эта сила работу над частицей не совершает, хы', 0),
(238, 203, '-', 'Так, закон сохранения энергии соответствует однородности времени, закон сохранения импульса — однородности пространства, закон сохранения момента импульса — изотропии пространства, закон сохранения электрического заряда — калибровочной симметрии и т. д.', 0),
(239, 204, '-', 'И́мпульс си́лы — это векторная физическая величина, равная произведению силы на время её действия, мера воздействия силы на тело за данный промежуток времени (в поступательном движении).', 0),
(240, 205, '-', 'Может быть, сумма кинетических энергий, потому что кинетическая энергия не расходуется на силы упругости и не переходит во внутреннюю энергия.', 0),
(241, 206, '-', 'Под реактивным понимают движение тела, возникающее при отделении некоторой его части с определенной скоростью относительно тела', 0),
(243, 208, '', '<a href=\"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D1%80%D0%BC%D1%83%D0%BB%D0%B0_%D0%A6%D0%B8%D0%BE%D0%BB%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE\">Вики</a>', 0),
(244, 207, '', '<a href=\"https://ru.wikipedia.org/wiki/%D0%A3%D1%80%D0%B0%D0%B2%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5_%D0%9C%D0%B5%D1%89%D0%B5%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE#:~:text=%D0%A3%D1%80%D0%B0%D0%B2%D0%BD%D0%B5%CC%81%D0%BD%D0%B8%D0%B5%20%D0%9C%D0%B5%D1%89%D0%B5%CC%81%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE%20%E2%80%94%20%D0%BE%D1%81%D0%BD%D0%BE%D0%B2%D0%BD%D0%BE%D0%B5%20%D1%83%D1%80%D0%B0%D0%B2%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5%20%D0%B2,%D1%82%D0%BE%D1%87%D0%BA%D0%B8%20%D0%BF%D0%B5%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9%20%D0%BC%D0%B0%D1%81%D1%81%D1%8B%20(%D1%81%D0%BE%D1%81%D1%82%D0%B0%D0%B2%D0%B0).&amp;text=%D0%A4%D0%BE%D1%80%D0%BC%D1%83%D0%BB%D0%B0%20%D0%A6%D0%B8%D0%BE%D0%BB%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE%20%D0%BC%D0%BE%D0%B6%D0%B5%D1%82%20%D0%B1%D1%8B%D1%82%D1%8C%20%D0%BF%D0%BE%D0%BB%D1%83%D1%87%D0%B5%D0%BD%D0%B0%20%D0%BA%D0%B0%D0%BA%20%D1%80%D0%B5%D0%B7%D1%83%D0%BB%D1%8C%D1%82%D0%B0%D1%82%20%D1%80%D0%B5%D1%88%D0%B5%D0%BD%D0%B8%D1%8F%20%D1%8D%D1%82%D0%BE%D0%B3%D0%BE%20%D1%83%D1%80%D0%B0%D0%B2%D0%BD%D0%B5%D0%BD%D0%B8%D1%8F.\">Вики</a>', 0),
(245, 209, '-', 'Сила тяги реактивного (ракетного) двигателя. Тяга – равнодействующая всех реактивных сил, создаваемых агрегатами двигателя, определяется по формуле: где – массовый секундный расход топлива реактивного двигателя;Wa – скорость газовой струи на срезе сопла; Fa – площадь среза сопла; ра – давление на срезе сопла; рh – давление окружающей среды.', 0),
(246, 210, '-', 'Центр тяжести - неизменно связанная с твердым телом точка, через которую проходит равнодействующая сил тяжести, действующих на частицы этого тела при любом положении тела в пространстве. У однородного тела, имеющего центр симметрии (круг, шар, куб и т. д.) , центр тяжести находится в центре симметрии тела. Положение центра тяжести твердого тела совпадает с положением его центра масс.', 0),
(247, 211, '-', 'Центр тяжести – геометрическая точка и может лежать и вне пределов тела', 0),
(248, 212, '-', 'нет, для любого изменения скорости требуется придать телу ускорение, а ускорение - составляющая часть силы', 0),
(249, 213, '-', 'Силы, работа которых зависит только от начальной и конечной координаты перемещения, называются консервативными. Работа консервативных сил по замкнутому контуру равна нулю. Примером таких сил являются силы тяжести и упругости. Силы, зависящие от скорости перемещения, неконсервативны (диссипативны).', 0),
(250, 214, 'Е = mgh', '', 0),
(251, 215, '-', 'Формулировка закона сохранения механической энергии. Полная механическая энергия, т.е. сумма потенциальной и кинетической энергии тела, остается постоянной, если действуют только силы упругости и тяготения и отсутствуют силы трени', 0),
(252, 216, '-', '<a href=\"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BC%D0%B5%D0%BD%D1%82_%D0%B8%D0%BC%D0%BF%D1%83%D0%BB%D1%8C%D1%81%D0%B0#:~:text=%D0%9C%D0%BE%D0%BC%D0%B5%CC%81%D0%BD%D1%82%20%D0%B8%CC%81%D0%BC%D0%BF%D1%83%D0%BB%D1%8C%D1%81%D0%B0%20(%D0%BC%D0%BE%D0%BC%D0%B5%D0%BD%D1%82%20%D0%B8%D0%BC%D0%BF%D1%83%D0%BB%D1%8C%D1%81%D0%B0%20%D0%BE%D1%82%D0%BD%D0%BE%D1%81%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE,%D0%BF%D1%80%D0%BE%D1%81%D1%82%D1%80%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%B5%20%D0%B8%20%D1%81%20%D0%BA%D0%B0%D0%BA%D0%BE%D0%B9%20%D1%83%D0%B3%D0%BB%D0%BE%D0%B2%D0%BE%D0%B9\">Вики</a>\r\n\r\nМоме́нт и́мпульса (момент импульса относительно точки, также: кинетический момент, угловой момент, орбитальный момент, момент количества движения) — физическая величина, характеризующая количество вращательного движения и зависящая от того, сколько массы вращается, как она распределена в пространстве и с какой угловой скоростью происходит вращение.\r\n\r\nДля одной материальной точки момент импульса равен векторному произведению радиус-вектора точки на её импульс, для системы точек — сумме таких произведений. \r\n\r\nМомент импульса замкнутой системы сохраняется. Он является одним из трёх аддитивных (энергия, импульс, момент импульса) интегралов движения. При наличии внешних сил, производная момента импульса по времени равна моменту сил (относительно того же начала O).\r\n\r\nОсновное использование понятия момента импульса относится к задачам, связанным с реальным вращением (особенно при наличии центральной или осевой симметрии; тогда О обычно выбирается в центре или на оси). Но величина Что такое момент инерции тела? L  может быть вычислена и в других ситуациях, например для прямолинейного движения частицы мимо произвольной точки O, не лежащей на линии движения и условно принимаемой за центр.', 0),
(253, 217, '-', 'Моме́нт ине́рции — скалярная физическая величина, мера инерции во вращательном движении вокруг оси, подобно тому, как масса тела является мерой его инертности в поступательном движении. Характеризуется распределением масс в теле:', 0),
(254, 218, '-', 'Закон сохранения момента импульса: момент импульса замкнутой системы тел относительно любой неподвижной точки не изменяется с течением времени. Это один из фундаментальных законов природы.', 0),
(255, 219, '-', 'увеличится в 1/2 раза.', 0),
(256, 220, '-', 'Модуль момента силы вычисляется по формуле. M = rF sin α, где r — длина радиус-вектора, проведенного от оси вращения к точке приложения силы; F — модуль приложенной к телу силы; α — угол между векторами. и. . Точка O, относительно которой рассчитывается момент приложенной к телу силы.', 0),
(257, 221, '-', 'Статика изучает равновесие тел под действием приложенных к ним сил. Равновесие - это состояние тела, при котором каждая его точка остаётся всё время неподвижной в некоторой инерциальной системе отсчёта. Условием равновесия материальной точки является равенство нулю равнодействующей (т. е. векторной суммы) всех сил, приложенных к точке.', 0),
(258, 183, '-', 'Момент силы относительно оси считается положительным, если проекция силы на плоскость, перпендикулярную оси, стремится повернуть тело вокруг положительного направления оси против часовой стрелки, отрицательным, если – по часовой стрелке.', 0),
(259, 222, '-', 'Момент силы относительно оси считается положительным, если проекция силы на плоскость, перпендикулярную оси, стремится повернуть тело вокруг положительного направления оси против часовой стрелки, отрицательным, если – по часовой стрелке.', 0),
(260, 224, '-', 'Кинетическая энергия тела, движущегося произвольным образом, равна сумме кинетических энергий всех n материальных точек па которые это тело можно разбить.', 0),
(261, 225, '-', 'Теорема Штейнера – момент инерции тела I относительно любой оси равен сумме момента инерции тела Io относительно параллельной оси, проходящей через центр масс тела, и произведения массы тела на квадрат расстояния между осями.', 0),
