(4, '4', '924', 'Array\n(\n    [task] => У человека нижняя челюсть является подвижной.\n\nУ лошади – то же самое.\n\nУ гуся– то же самое.\n\nУ щуки – то же самое.\n\nУ змеи – то же самое.\n\nСледовательно: «Все позвоночные имеют подвижную нижнюю\nчелюсть».\n\nДанный логический вывод сделан\n    [testId] => 31\n    [roomId] => 4\n)\n', '2022-07-01 07:54:59'),
(5, '5', '924', 'Array\n(\n    [task] => У человека нижняя челюсть является подвижной.\n\nУ лошади – то же самое.\n    [testId] => 31\n    [roomId] => 5\n)\n', '2022-07-01 07:48:23'),
