(7, '7', '398', 'Array\n(\n    [task] => Язык С++. Выберите все выражения НЕ приводящие к ошибке.\n    [answers] => A) int& pi;\nB) int& pi[10];\nC) int* pi;\nD) int* pi[10];\nE) std::vector<int&> pi;\nF) std::vector<int*> pi;\n    [testId] => 22\n    [roomId] => 7\n)\n', '2021-03-04 15:52:16'),
(8, '8', '409', 'Array\n(\n    [task] => Дан фрагмент кода на С++. Что отобразится на экране после его выполнения?\nint a = 5;\nint b = 15;\nif (a < b); std::cout << a;\nelse; std::cout << b;\n    [answers] => A) 15\nB) 155\nC) 5\nD) 515\nE) Ничего\nF) Ошибка компиляции\n    [testId] => 22\n    [roomId] => 8\n)\n', '2021-03-04 15:49:20'),
(9, '9', '165', 'Array\n(\n    [task] => Дан фрагмент кода на С++. Что будет напечатано в результате его выполнения?\nint main(){\n    bool i = true;\n    {\n        int i = 5;\n        i = !i;\n    }\n    std::cout << i;\n}\n    [answers] => A) 0\nB) 1\nC) 5\nD) false\nE) true\nF) Ошибка\n    [testId] => 22\n    [roomId] => 9\n)\n', '2021-03-04 17:15:13'),
