(12, '12', '396', 'Array\n(\n    [task] => Язык С++. Выберите все верные утверждения.\n\nint const * const pi = &i;\n    [answers] => A) i может быть объявлена как int const * i;\nB) i может быть объявлена как int const i;\nC) i может быть объявлена как int i;\nD) Значение pi можно менять\nE) Значение pi нельзя менять\n    [testId] => 22\n    [roomId] => 12\n)\n', '2021-03-04 16:35:18'),
