(14, '14', '353', 'Array\n(\n    [task] => Дан фрагмент кода на Python. Что будет напечатано в результате его выполнения?\n\ndef main():\n    def foo():\n        global i\n        i = 1\n        print(i, end=\'\')\n    foo()\n    print(i, end=\'\')\n    \nmain()\nprint(i, end=\'\')\n    [answers] => A) 111\nB) 1NoneNone\nC) None\nD) Ничего\nE) Ошибка\n    [testId] => 22\n    [roomId] => 14\n)\n', '2021-01-25 07:42:43'),
(15, '15', NULL, 'Array\n(\n    [task] => Дан фрагмент кода на С++. Что будет выведено на экран в результате выполнения данного фрагмента?\nint x = 5;\n(x != 5 ) && (std::cout << 11);\nstd::cout << x;\n    [answers] => \n    [testId] => 22\n    [roomId] => 15\n)\n', '2021-01-25 07:35:30'),
(16, '16', '45', 'Array\n(\n    [task] => Дан фрагмент кода на С++. Что будет напечатано в результате выполнения следующего фрагмента кода:\nint a = 5;\nint b = 6;\nstd::cout << a << ( (a > b)? 1 : \" <= \" ) << b;\n    [answers] => A) 5 <= 16\nB) 5 <= 6\nC) 51 <= 6\nD) 516\nE) Ничего\nF) Ошибка компиляции\n    [testId] => 22\n    [roomId] => 16\n)\n', '2021-01-25 08:02:21'),
(17, '17', '150', 'Array\n(\n    [task] => Дан фрагмент кода на С++. Что будет напечатано в результате его выполнения?\nnamespace A{\n    int i = 1;    \n}\n\nint main() {\n    std::cout << i;\n    int i = 2;\n}\n    [answers] => A) 1\nB) 2\nC) Ошибка\n    [testId] => 22\n    [roomId] => 17\n)\n', '2021-01-25 07:54:24'),
