(264, 'Язык С++. Что из нижеперечисленного может быть полем структуры?\r\n\r\nA) Примитивные типы (int, double, ...)\r\n\r\nB) Строки\r\n\r\nC) Структуры и Классы\r\n\r\nD) Массивы\r\n\r\nE) Указатели ', 25, '', '2021-01-20 04:45:58'),
(265, 'Какое ключевое слово нужно использовать при определении структуры в С++?\r\n\r\nA) object\r\n\r\nB) record\r\n\r\nC) structure\r\n\r\nD) Record\r\n\r\nE) struct\r\n\r\nF) Struct ', 25, '', '2021-01-20 04:37:39'),
(266, 'Язык С++. Дан тип данных и прототип функции:\r\n\r\nstruct Point{\r\n    int x,y;\r\n};\r\n\r\nvoid foo(Point p);\r\nЕсли передать переменную типа Point в функцию foo, то:\r\n\r\nA) Внутри функции будет доступен оригинал структуры\r\n\r\nB) Ошибка. Т.к. структуры нельзя передавать в функции\r\n\r\nC) Внутри функции будет доступна копия структуры\r\n\r\nD) Внутри функции будет создана пустая структура (т.е. поля содержат \"мусор\") ', 25, '', '2021-01-20 04:40:18'),
(267, 'Каким образом можно создать переменную типа структура в языке С++?\r\n\r\nA)struct Point (p1, p2){\r\nint x,y;\r\n};\r\n\r\nB)struct{\r\nint x,y;\r\n} P1, p2;\r\n\r\nC)struct Point{\r\nint x,y;\r\n} P1, p2;\r\n\r\nD)p1, p2: struct Point{\r\nint x,y;\r\n};\r\n\r\nE)struct Point{\r\nint x,y;\r\n};\r\nPoint;\r\n\r\nF)struct Point{\r\nint x,y;\r\n};\r\nPoint p1, p2;', 25, '', '2021-01-20 05:01:41'),
(268, 'Язык C++. Дана структура:\r\n\r\nstruct Point{\r\n    int x,y;\r\n};\r\n\r\nВыберите фрагменты не вызывающие ошибки.\r\n\r\nA) Point p={1, 1}, p2;\r\n    p2 = {p.x, p.y};\r\n\r\nB) Point p={1, 2}, p2;\r\n   p2 = p;\r\n\r\nC) Point p={1, 2}, p={2, 2};\r\n   p2 = p2 + p;\r\n\r\nD) Point p;\r\n   p = {1, 1};\r\n\r\nE) Point p={1, 2}, p={2, 2};\r\n   p2.x = p2.x + p.x;\r\n   p2.y = p2.y + p.y;', 25, '', '2021-01-17 16:18:40'),
(269, 'Дан фрагмент кода на языке С++:\r\n\r\nstruct One{\r\n    int x,y;\r\n} a;\r\n\r\nstruct Two{\r\n    int x,y;\r\n} b;\r\nДопустим ли следующий код?\r\n\r\na = {1, 2};\r\nb = a;\r\n\r\nA) Да, b получит копию полей a\r\n\r\nB) Да, a и b будут ссылаться на одни и те же значения\r\n\r\nC) Нет, т.к. у a и b разные типы\r\n\r\nD) Нет, для типа данных: структура, разрешено только почленное присваивание ', 25, '', '2021-01-20 04:34:22'),
(270, 'Язык С++. Что из нижеперечисленного - правильное определение структуры?\r\n\r\nA) struct a_struct int a;\r\n\r\nB) struct a_struct {\r\n    int a;\r\n}\r\n\r\nC) struct {\r\n    int a;\r\n}\r\n\r\nD) struct a_struct{\r\n    int a;\r\n};\r\n\r\nE) struct {\r\n    int a;\r\n} s; ', 25, '', '2021-01-20 04:36:57'),
(271, 'Дан фрагмент кода на языке С++:\r\n\r\nstruct One{\r\n    int x,y;\r\n} a, b;\r\nДопустим ли следующий код?\r\n\r\na = {1, 2};\r\nb = a;\r\n\r\nA) Да, b получит копию полей a\r\n\r\nB) Нет, для типа данных: структура, разрешено только почленное присваивание\r\n\r\nC) Нет, т.к. у a и b разные типы\r\n\r\nD) Да, a и b будут ссылаться на одни и те же значения ', 25, '', '2021-01-20 04:19:09'),
(272, 'Язык С++. Какая структура называется анонимной?\r\nA) struct Point{\r\n    int x,y;\r\n} anonymous;\r\n\r\nB) anonymous struct Point{\r\n    int x,y;\r\n} s;\r\n\r\nC) В С++ нет анонимных структур\r\n\r\nD) struct Point{\r\n    int x,y;\r\n} s;\r\n\r\nE) struct {\r\n    int x,y;\r\n} s;\r\n\r\nF) struct anonymous{\r\n    int x,y;\r\n} s; ', 25, '', '2021-01-20 04:05:38');
INSERT INTO `pycpp_task` (`id_task`, `task_question`, `task_id_test`, `task_screenshot`, `task_modification_date`) VALUES
(273, 'Дан фрагмент кода на С++. Каким образом можно получить доступ к полю структуры?\r\n\r\nstruct Point{\r\n    double x, y;\r\n} p;\r\n\r\nA) p->x;\r\n\r\nB) p-x;\r\n\r\nC) p>x;\r\n\r\nD) p~x;\r\n\r\nE) p.x;\r\n\r\nF) p<-x; ', 25, '', '2021-01-20 03:57:41'),
(274, 'Язык С++. Дана структура:\r\n\r\nstruct Point{\r\n    int x,y;\r\n};\r\nКаким образом можно инициализировать переменную данного типа?\r\nA) Point p = {};\r\n\r\nB) Point(1, 2) p;\r\n\r\nC) Point p {1, 2};\r\n\r\nD) Point p {x=1, y=1};\r\n\r\nE) Point p = {1, 1};\r\n\r\nF) Point p = [1, 1]; ', 25, '', '2021-01-20 03:51:08'),
