(301, '27. Переменные. Глобальные переменные. Локальные переменные. Лексическое и динамическое связывание.\r\n', 29, '', '2021-01-18 21:22:03'),
(302, '28. Области видимости. Пространства имен. Создание пользовательских пространств имён. Примеры использования.\r\n', 29, '', '2021-01-18 21:22:13'),
(303, '29. Области видимости. Пространства имен. Анонимные пространства имён. Примеры использования.\r\n', 29, '', '2021-01-18 21:22:23'),
(304, '30. Контейнеры/коллекции. Создание. Инициализация. Итерирование. Изменение.\r\n', 29, '', '2021-01-18 21:22:30'),
(305, 'Где можно определить структуру в языке С++?\r\n\r\nA) Внутри других структур\r\n\r\nB) Внутри списка параметров функции\r\n\r\nC) Внутри пользовательских пространств \r\nимён (namespace)\r\n\r\nD) Внутри тела функции\r\n\r\nE) Вне функции\r\n\r\nF) Внутри объявления массивов ', 25, '', '2021-01-20 03:50:29'),
(308, 'Дан фрагмент кода на языке С++:\r\n\r\nenum class Color {\r\n    YELLOW = -2,\r\n    BLACK,\r\n    PINK\r\n} color = Color::BLACK;\r\n\r\nВыберите верные выражения (комментарий).\r\n\r\nA) color = 2*Color::BLACK - Color::YELLOW; // color будет равно Color::PINK\r\n\r\nB) Нет верных выражений\r\n\r\nC) Color mix = 2*Color::BLACK; // mix будет равно Color::YELLOWD) \r\nint i = Color::BLACK + Color::PINK; // i будет равно -1\r\n\r\nE) int i = color + Color::BLACK; // i будет равно -2\r\n\r\nF) int i = 2 + 2*Color::PINK; // i будет равно 2\r\n\r\nG) Color mix = Color(2*Color::BLACK + 1); // mix будет равно Color::BLACK', 26, '', '2021-01-20 15:28:00'),
(309, 'Язык С++. Выберите все утверждения верные для перечисления\r\n\r\nA) Перечислителю присваивается значение только в том случае, если его явно указал программист\r\n\r\nB) Имена перечислителей могут быть записаны в любом регистре\r\n\r\nC) В объявлении перечисления перечислители разделяются запятой\r\n\r\nD) Имена перечислителей должны быть записаны в верхнем регистре\r\n\r\nE) Каждому перечислителю автоматически присваивается целочисленное значение, кроме тех, у которых значение уже прописано в коде\r\n\r\nF) В объявлении перечисления перечислители разделяются точкой с запятой', 26, '', '2021-01-20 15:23:07'),
(310, 'Дан фрагмент кода на языке С++:\r\n\r\nenum Color {\r\n    YELLOW = -2,\r\n    BLACK,\r\n    PINK\r\n} color = BLACK;\r\nВыберите верные выражения (комментарий).\r\n\r\nA) int i = 2 + 2*PINK; // i будет равно 2\r\n\r\nB) int i = color + BLACK; // i будет равно -2\r\n\r\nC) int i = BLACK + PINK; // i будет равно -1\r\n\r\nD) color = 2*BLACK - YELLOW; // color будет равно PINK\r\n\r\nE) Color mix = 2*BLACK; // mix будет равно YELLOW\r\n\r\nF) Нет верных выражений\r\n\r\nG) Color mix = Color(2*BLACK + 1); // mix будет равно BLACK', 26, '', '2021-01-23 19:09:04'),
(311, 'Дан фрагмент кода на языке С++:\r\n\r\nenum Color {\r\n    YELLOW = -2,\r\n    BLACK,\r\n    PINK = -2,\r\n    GREEN\r\n};\r\n\r\nВыберите верные утверждения (комментарий).\r\n\r\nA) int i = BLACK;  // i равно -2\r\n\r\nB) int i = GREEN;  // i равно -1\r\n\r\nC) Ошибка. Дублирование значений.\r\n\r\nD) GREEN и BLACK содержат мусорные значения\r\n\r\nE) int i = BLACK;  // i равно -1\r\n\r\nF) int i = GREEN;  // i равно -2', 26, '', '2021-01-20 15:31:24'),
(312, 'Язык С++. Известно, что размер int равен 4 байта, double - 8 байт, char - 1 байт.\r\nunion {\r\n    int i;\r\n    double d;\r\n    char c;\r\n} myVar;\r\nЧему будет равен размер переменной myVar?\r\n\r\nA) 4 байт\r\n\r\nB) 24 байт\r\n\r\nC) 8 байт\r\n\r\nD) 13 байт\r\n\r\nE) 16 байт', 26, '', '2021-01-20 15:34:08'),
(313, 'Дан фрагмент кода на языке С++:\r\nenum Color {\r\n    COLOR_BLACK = -10,\r\n    COLOR_RED\r\n};\r\n\r\nColor col = Color::COLOR_RED;\r\nstd::cout << col;\r\nЧто отобразится на экране в результате выполнения данного фрагмента?\r\n\r\nA) Ошибка. Не определён оператор <<\r\n\r\nB) Текст: COLOR_RED\r\n\r\nC) -11\r\n\r\nD) Какое-то \"мусорное\" значение, т.к. \r\nоно явно не задано программистом\r\n\r\nE) -9\r\n\r\nF) Ошибка. Перечислителю нельзя присваивать отрицательные значения', 26, '', '2021-01-20 15:43:59'),
(314, 'Дан фрагмент кода на языке С++:\r\n\r\nunion {\r\n    int i;\r\n    double d;\r\n    char c;\r\n} myVar;\r\n\r\nmyVar.i = 200;\r\nmyVar.d = 200;\r\n\r\nВыберите верные утверждения.\r\n\r\nA) Переменная myVar будет хранить в себе значения i и d независимо друг от друга\r\n\r\nB) Переменная myVar будет хранить в себе только значения d, т.к. его присвоили последним\r\n\r\nC) Тип myVar - объединение\r\n\r\nD) Тип myVar - перечисление\r\n\r\nE) Тип myVar - структура\r\n\r\nF) Переменная myVar будет хранить в себе только значения i, т.к. его присвоили первым', 26, '', '2021-01-20 15:58:42'),
(315, 'Дан фрагмент кода на языке С++:\r\n\r\nenum class Color {\r\n    COLOR_BLACK = -10,\r\n    COLOR_RED\r\n};\r\n\r\nColor col = Color::COLOR_RED;\r\nstd::cout << col;\r\n\r\nЧто отобразится на экране в результате выполнения данного фрагмента?\r\n\r\nA) -9\r\n\r\nB) -11\r\n\r\nC) Текст: COLOR_RED\r\n\r\nD) Ошибка. Не определён оператор <<\r\n\r\nE) Ошибка. Перечислителю нельзя присваивать отрицательные значения\r\n\r\nF) Какое-то \"мусорное\" значение, т.к. оно явно не задано программистом', 26, '', '2021-01-20 16:09:08'),
(316, 'Язык С++. Выберите все способы получения значения со стандартного ввода.\r\n\r\nenum Color {\r\n    YELLOW = 0,\r\n    BLACK = 1,\r\n    PINK = 2\r\n} color;\r\n\r\n\r\nA) int i; \r\n   std::cin >> i; // Пользователь вводит число: 0\r\ncolor = static_cast<Color>(i);\r\n\r\nB) std::cin >> color; // Пользователь вводит число: 0\r\n\r\nC) std::string str;\r\n   std::cin >> str; // Пользователь вводит строку: YELLOW\r\ncolor = static_cast<Color>(str);\r\n\r\nD) int i;\r\nstd::cin >> i; // Пользователь вводит число: 0\r\ncolor = Color(i);\r\n\r\nE) color = static_cast<Color>(std::cin); // Пользователь вводит число: 0\r\n\r\nF) std::cin >> color; // Пользователь вводит строку: YELLOW', 26, '', '2021-01-20 19:06:40'),
(317, 'Дан фрагмент кода на языке С++:\r\n\r\nint main()\r\n{\r\n    enum class Move {\r\n        LEFT,\r\n        RIGHT\r\n    };\r\n\r\n    int LEFT = 5;\r\n    Move m = Move::RIGHT;\r\n    std::cout << m;\r\n}\r\n\r\nЧто отобразится на экране в результате выполнения данного фрагмента?\r\n\r\nA) Ошибка. Для Move не определён операторы <<\r\n\r\nB) 1\r\n\r\nC) Строка RIGHT\r\n\r\nD) Ошибка. RIGHT НЕ присвоено значение\r\n\r\nE) Ошибка. Повторное использование имени LEFT\r\n\r\nF) 0', 26, '', '2021-01-20 20:37:24'),
(318, 'Дан фрагмент кода на языке С++.\r\nint main()\r\n{\r\n    enum Move {\r\n        LEFT,\r\n        RIGHT\r\n    };\r\n\r\n    Move m = Move::RIGHT;\r\n    std::cout << m;\r\n}\r\nЧто выведется на экран в результате его работы?\r\n\r\nA) Ошибка. Для Move не определён операторы <<\r\n\r\nB) 1\r\n\r\nC) Строка RIGHT\r\n\r\nD) Ошибка. RIGHT НЕ присвоено значение\r\n\r\nE) 0', 26, '', '2021-01-20 21:09:53'),
(319, 'Дан фрагмент кода на языке С++\r\nint main()\r\n{\r\n    enum Move {\r\n        LEFT,\r\n        RIGHT\r\n    };\r\n\r\n    int LEFT = 5;\r\n    Move m = Move::RIGHT;\r\n    std::cout << m;\r\n}\r\nЧто выведется на экран в результате его работы?\r\n\r\nA) 1\r\n\r\nB) Ошибка. RIGHT НЕ присвоено значение\r\n\r\nC) Строка RIGHT\r\n\r\nD) 0\r\n\r\nE) Ошибка. Для Move не определён операторы <<\r\n\r\nF) Ошибка. Повторное использование имени LEFT', 26, '', '2021-01-20 21:12:04'),
(320, 'Дан фрагмент кода на языке С++. Известно, что размеры Color и int равны.\r\nenum Color {\r\n    YELLOW,\r\n    BLACK,\r\n    PINK\r\n};\r\n\r\nunion Conv {\r\n    int i;\r\n    Color c;\r\n} myVar;\r\nК чему приведёт следующий код?\r\n\r\nstd::cin >> myVar.i;  // Пользователь вводит 0\r\n\r\nA) myVar.с станет равно YELLOW\r\n\r\nB) myVar.i станет равно 0\r\n\r\nC) myVar.с будет равно \"мусору\", т.к. \r\nоно не инициализировано\r\n\r\nD) Ошибка. Членами union могут быть только примитивные типы', 26, '', '2021-01-20 21:15:21'),
(321, 'Дан фрагмент кода на языке С++:\r\n\r\nenum class Color {\r\n    YELLOW = 0,\r\n    BLACK = 1,\r\n    PINK = 2\r\n} color = Color::BLACK;\r\n\r\nи функция с представленным ниже прототипом:\r\n\r\nvoid foo(Color clr);\r\n\r\nКакой вариант вызова функции НЕ приведёт к ошибке?\r\n\r\nA) foo(color);\r\n\r\nB) foo(Color(1));\r\n\r\nC) foo(\"YELLOW\");\r\n\r\nD) foo(Color::YELLOW);\r\n\r\nE) foo(YELLOW);\r\n\r\nF) foo(1);', 26, '', '2021-01-20 21:33:13'),
(322, 'Язык С++. Переменная-ссылка r связана с некоторой переменной i.\r\nКак получить доступ к значению переменной i через r?\r\n\r\nA) Просто использовать в выражениях r вместо i\r\n\r\nB) Применить к r оператор разыменования\r\n\r\nC) Применить к r оператор разрешения контекста\r\n\r\nD) Применить к r оператор взятия адреса', 27, '', '2021-01-20 23:15:00'),
(323, 'Язык С++. Переменная-указатель p хранит адрес некоторой переменной i.\r\nКак получить доступ к значению переменной i по её адресу?\r\n\r\nA) Применить к p оператор разрешения контекста\r\n\r\nB) Применить к p оператор разыменования\r\n\r\nC) Применить к p оператор взятия адреса\r\n\r\nD) Просто использовать в выражениях p вместо i', 27, '', '2021-01-20 23:15:56'),
(324, 'Дан фрагмент кода на С++. Выберите все верные утверждения:\r\n\r\nint i = 10;\r\nint j = 20;\r\nint& pi = i;\r\npi = j;\r\npi = 30;\r\n\r\nA) j станет равно 30\r\n\r\nB) i станет равно 30\r\n\r\nC) pi = 30; Изменит значение как i, так и j на 30\r\n\r\nD) Ошибка. После создания значение ссылки изменять нельзя', 27, '', '2021-01-20 23:46:07'),
(325, 'Дан фрагмент кода на С++. Выберите все верные утверждения:\r\n\r\nint i = 10;\r\nint j = 20;\r\nint* pi = &i;\r\npi = &j;\r\n*pi = 30;\r\n\r\nA) Ошибка. После создания значение указателя изменять нельзя\r\n\r\nB) j станет равно 30\r\n\r\nC) i станет равно 30\r\n\r\nD) *pi = 30; Изменит значение как i, так и j на 30', 27, '', '2021-01-20 23:48:38'),
(326, 'Язык С++. Известно, что переменные объявлены следующим образом:\r\n\r\nint i = 10;\r\nint *p = &i;\r\n\r\nВыберите все верные утверждения.\r\n\r\nA)& - ссылка на переменную i\r\n\r\nB)* - оператор разыменования\r\n\r\nC)* - указатель\r\n\r\nD)& - оператор побитовое И\r\n\r\nE)& - оператор логическое И\r\n\r\nF)* - часть описания типа переменной\r\n\r\nG)* - оператор умножения\r\n\r\nH)& - оператор взятия адреса', 27, '', '2021-01-21 00:04:28'),
(327, 'Дан фрагмент кода на языке С++:\r\n\r\nint i = 10;\r\nint *p = &i;\r\nstd::cout << *p;\r\n\r\nВыберите все верные утверждения (нумерация строк с единицы).\r\n\r\nA) Результат выражения &i во 2й строке - адрес\r\n\r\nB) Результат выражения *p в 3й строке - указатель на целое число\r\n\r\nC) На экране появится адрес переменной i\r\n\r\nD) p - хранит адрес переменной i\r\n\r\nE) Результат выражения *p в 3й строке - целое число\r\n\r\nF) Результат выражения &i во 2й строке - ссылка на целое число\r\n\r\nG) На экране появится 10', 27, '', '2021-01-21 00:24:49'),
(328, 'Дан фрагмент кода на С++. Выберите все верные утверждения\r\n\r\nint i = 10;\r\nint* pi = &i;\r\nint* pj = &i;\r\n\r\nA) При помощи указателя pj можно получить доступ к переменной i\r\n\r\nB) Выражение &pi == &pj истинно\r\n\r\nC) Через переменную i можно получить доступ к переменным pi и pj\r\n\r\nD) При помощи указателя pi можно получить доступ к переменной i\r\n\r\nE) Выражение pi == pj истинно', 27, '', '2021-01-21 00:36:38'),
(329, 'Язык С++. Известно, что переменные объявлены следующим образом:\r\n\r\nint i = 10;\r\nint *p = &i;\r\nint &r = i;\r\n\r\nВыберите все верные утверждения.\r\n\r\nA) &r - это ссылка\r\n\r\nB) &r - это указатель\r\n\r\nC) p - это ссылка\r\n\r\nD) r - это ссылка\r\n\r\nE) r - это указатель\r\n\r\nF) *p - это ссылка\r\n\r\nG) *p - это указатель\r\n\r\nH) p - это указатель', 27, '', '2021-01-21 01:08:09'),
(330, 'Язык С++. Известно, что переменные объявлены следующим образом:\r\n\r\nint i = 10;\r\nint &p = i;\r\n\r\nВыберите все верные утверждения.\r\n\r\nA) & - это ссылка\r\n\r\nB) & - оператор взятия адреса\r\n\r\nC) & - оператор логическое И\r\n\r\nD) & - часть описания типа переменной\r\n\r\nE) & - оператор побитовое И', 27, '', '2021-01-21 02:00:51'),
(331, 'Язык С++. Какой тип данных у переменной pj?\r\n\r\nint i = 10, j = 20;\r\nint& pi = i, pj = j;\r\n\r\nA) Просто int\r\n\r\nB) Указатель на int\r\n\r\nC) Ошибка. Перед j и pj не указан тип\r\n\r\nD) Ссылка на int', 27, '', '2021-01-21 02:06:43'),
(332, 'Язык С++. На какой знак нужно заменить символ # в данном фрагменте кода, чтобы pj стал указателем на int?\r\n\r\nint i = 10, j = 20;\r\nint* pi, #pj = &j;\r\n\r\nA) Ничего не менять\r\n\r\nB) # заменить на &\r\n\r\nC) # заменить на пробел (тоже, что и убрать #)\r\n\r\nD) # заменить на *', 27, '', '2021-01-21 02:18:30'),
(333, 'Язык С++. Дан вектор:\r\n\r\nstd::vector<int> arr = {0, 1, 2, 3, 4, 5};\r\n\r\nи функция:\r\n\r\nvoid reverse(std::vector<int>& arr){\r\n    for(auto i=0; i<arr.size()/2; i++)\r\n        std::swap(arr[i], arr[arr.size()-1 - i]);\r\n}\r\n\r\nесли вызвать функцию следующим образом:\r\n\r\nreverse(arr);\r\n\r\nто массив будет содержать:\r\n\r\nA) 1, 0, 3, 2, 5, 4\r\n\r\nB) 0, 1, 2, 3, 4, 5\r\n\r\nC) 5, 4, 3, 2, 1, 0\r\n\r\nD) 4, 5, 2, 3, 0, 1', 28, '', '2021-01-21 02:46:38'),
(336, 'Кокой тип переменных в С++ предназначен для хранения логических данных?\r\n\r\nA) double\r\nB) char\r\nC) short\r\nD) bool\r\nE) float\r\nF) int', 1, '', '2021-01-21 15:27:24'),
(337, 'Дан фрагмент кода на Python. Что будет напечатано в результате его выполнения?\r\n\r\ni = 1\r\n\r\ndef main():\r\n    def foo():\r\n        def bar():\r\n            print(i, end=\'\')\r\n        bar()\r\n    i = 2\r\n    foo()\r\n    \r\nmain()\r\n\r\nA) 2\r\n\r\nB) 0\r\n\r\nC) 1\r\n\r\nD) Ничего\r\n\r\nE) Ошибка', 23, '', '2021-01-21 15:29:18'),
(338, 'Дан фрагмент кода на С++. Что будет напечатано в результате выполнения фрагмента кода:\r\n\r\nint a = 5;\r\nint b = 6;\r\nstd::cout << ( (a > b)? b : a );', 1, '', '2021-01-21 15:44:36'),
