(387, 'Язык С++. Выберите все верные утверждения касающиеся перегрузки операторов.\r\n\r\nA) Приоритет/ассоциативность оператора НЕ меняется после перегрузки\r\nB) Перегрузить оператор можно для любой пары типов (для бинарных)\r\nC) Все операторы можно перегрузить в виде отдельных функций\r\nD) Все существующие в языке операторы можно перегрузить\r\nE) Можно написать перегрузку оператора которого нет в языке\r\nF) НЕ все существующие в языке операторы можно перегрузить\r\nG) Приоритет/ассоциативность оператора меняется после перегрузки\r\nH) НЕ все операторы можно перегрузить в виде отдельных функций\r\nI) Перегрузить оператор можно только если один из типов НЕ относится к примитивным (для бинарных)\r\nJ) Нельзя написать перегрузку оператора которого нет в языке', 24, '', '2021-01-21 22:51:29'),
