(465, 'Дан фрагмент кода на C++.\nint k = 10;\nwhile(--k) cout << 0;\nСколько раз выполнится цикл?\n\n', 25, '', '2021-01-25 10:46:42'),
(466, 'Дан фрагмент кода на С++. Что будет напечатано в результате его выполнения?\nint main(){\n    bool i = true;\n    {\n        int i = 5;\n        i = !i;\n        std::cout << i;\n    }\n}\n\nA) 0\nB) 1\nC) 5\nD) false\nE) true\nF) Ошибка', 25, '', '2021-01-25 10:47:01'),
(470, 'Язык C++. Что делает оператор continue вызванный внутри цикла?\n\nA) Данный оператор игнорируется\nB) Заставляет цикл выполняться с начала\nC) Ошибка. Оператор continue не используется в циклах\nD) Прерывает выполнение цикла\nE) Принудительный переход к следующей итерации цикла', 25, '', '2021-01-25 10:50:33'),
(471, 'Язык С++. Дан вектор:\n\nstd::vector<int> arr = {0, 1, 2, 3, 4, 5};\n\nи функция:\n\nvoid reverse(std::vector<int> arr){\n    for(auto i=0; i<arr.size()/2; i++)\n        std::swap(arr[i], arr[arr.size()-1 - i]);\n}\n\nесли вызвать функцию следующим образом:\n\nreverse(arr);\n\nто массив будет содержать:\n\nA) 0, 1, 2, 3, 4, 5\nB) 1, 0, 3, 2, 5, 4\nC) 4, 5, 2, 3, 0, 1\nD) 5, 4, 3, 2, 1, 0', 25, '', '2021-01-25 10:50:54'),
(472, 'Дан фрагмент кода на С++. Что отобразится на экране после его выполнения?\n\ntemplate<typename T>\nT sum(T a, T b){\n    auto res = a + b;\n    return res;\n}\n\nint main()\n{\n    std::cout << sum(3.0, 0.1415);\n}\n\nA) 0.1415\nB) 3\nC) 3.1415\nD) Ошибка компиляции', 25, '', '2021-01-25 10:51:50'),
(473, 'Язык С++. В функцию foo передаётся аргумент, значение которого НЕ равно 10. Какие из функций изменят значение своего аргумента?\n\nA) void foo(int i = 10){\n}\nB) void foo(int i){\n    i = 10;\n}\nC) void foo(int& i){\n    i = 10;\n}\nD) void foo(int* i){\n    *i = 10;\n}', 25, '', '2021-01-25 10:52:39'),
(474, 'Язык С++. Выберите все выражения НЕ приводящие к ошибке.\n\nint i = 10;\ndouble k = 10;\nint *a;\ndouble *b;\n\nA) *b = *a;\nB) a = &i;\nC) a = &k;\nD) b = &i;\nE) b = &k;\nF) b = a;', 25, '', '2021-01-25 10:53:36'),
(475, 'Язык C++. Существует ли форма оператора break позволяющая выйти сразу из 2х или более вложенных друг в друга циклов?\n\nA) Да, break с меткой\nB) Нет', 25, '', '2021-01-25 10:54:57'),
(476, 'Язык С++. Какой тип данных у переменной pj?\n\nint i = 10, j = 20;\nint& pi = i, pj = j;\n\nA) Ошибка. Перед j и pj не указан тип\nB) Просто int\nC) Ссылка на int\nD) Указатель на int', 25, '', '2021-01-25 10:55:04'),
(477, 'Выберите все обязательные элементы switch в С++:\n\nA) ()\nB) break\nC) case\nD) default\nE) {}', 25, '', '2021-01-25 10:55:27'),
(478, 'Дан фрагмент кода на Python. Что будет выведено на экран после выполнения фрагмента кода?\nfor i in range(1):\n    k = 10\n    print(i, end = \')\nprint(k)\n\nA) 010\nB) 0110\nC) 110\nD) Ошибка', 25, '', '2021-01-25 10:55:54'),
(479, 'Дан фрагмент кода на С++. Что отобразится на экране после его выполнения?\n\nvoid print(const int  a){\n    std::cout << -a;\n}\n\nvoid print(int a){\n    std::cout << a;\n}\n\nint main()\n{\n    int i = 10;\n    print(i);\n}\n\nA) -10\nB) 10\nC) Ничего\nD) Ошибка компиляции', 25, '', '2021-01-25 10:57:42'),
(480, 'Дан фрагмент кода на Python. Сколько раз выполнится цикл?\nk = 10\nwhile k: \n    print(0)\n    k -= 1\n\n\n', 25, '', '2021-01-25 10:58:07'),
(481, 'Дан фрагмент кода на Python. Что отобразится на экране после его выполнения?\na, b = 101, 3\nif a < b:\n    print(a, end = \')\n\nA) 101\nB) 1013\nC) 3\nD) 3101\nE) Ничего\nF) Ошибка', 25, '', '2021-01-25 10:59:22'),
(482, 'Дан фрагмент кода на С++. Что будет напечатано в результате выполнения данного фрагмента, если известно, что long - 4 байта, в  long long - 8 байт?\n\n#define WIN32\n#ifndef WIN32\n  long i;\n#else\n  long long i;\n#endif\nstd::cout << sizeof(i);\n\nA) \"sizeof(i)\"\nB) 4\nC) 8\nD) Ничего\nE) Ошибка', 25, '', '2021-01-25 10:59:33');
