(483, 'Язык Python. Существует ли форма оператора break позволяющая выйти сразу из 2х или более вложенных друг в друга циклов?\n\nA) Да, break с меткой\nB) Нет', 25, '', '2021-01-25 11:00:18'),
(484, 'Дан фрагмент кода на С++. Что отобразится на экране после его выполнения?\nint x = 5;\nstd::cout << (x || x*x);\n\n', 25, '', '2021-01-25 11:00:33'),
(485, 'Дан фрагмент кода на С++. Что отобразится на экране после его выполнения?\nint a = 0, b = 10;\nif (b <= 5 <= a) std::cout << 1;\nelse std::cout << 0;\n\n', 25, '', '2021-01-25 11:01:15'),
(486, 'Дан фрагмент кода на Python. Что будет напечатано в результате его выполнения?\n\ndef a():\n    print(i, end=\')  \n\ndef main():\n    a()\n\ni = 1\n\nmain()\n\nA) 1\nB) 10\nC) None\nD) Ничего\nE) Ошибка', 25, '', '2021-01-25 11:01:43'),
(487, 'Дан фрагмент кода на C++. Какие из следующих циклов являются бесконечными?\n\nA) for(0;0;0);\nB) for(short i=1; ; i++) cout << i;\nC) for(short i=1; i != 0; i++) cout << i;\nD) for(short i=1; i <100; ) {\n    if (i == 99) break;\n    cout << i;\n    i++;\n}\nE) for(short i=1; i <100; ) {\n    if (i == 99) continue;\n    cout << i;\n    i++;\n}\nF) for(short i=1; i++; ) {\n    cout << i;\n}', 25, '', '2021-01-25 11:03:30'),
(488, 'Код на С++. Выберите все правильные варианты, если известно, что:\n\n- main.cpp лежит в папке C:Project и включает firs_file.h \n- нужный firs_file.h лежит в папке C:Projectinclude и включает second_file.h\n- нужный second_file.h лежит в папке C:Projectinclude и ничего не включает.\nВ проекте могут дополнительно присутствовать и другие firs_file.h и second_file.h и каталоги с любым названием.\nВсе пути не входят в число стандартных путей поиска.\n\nA) В firs_file.h - #include \"include/second_file.h\"\nB) В firs_file.h - #include \"second_file.h\"\nC) В firs_file.h - #include <include/second_file.h>\nD) В firs_file.h - #include <second_file.h>\nE) В main.cpp - #include \"firs_file.h\"\nF) В main.cpp - #include \"include/firs_file.h\"\nG) В main.cpp - #include <firs_file.h>\nH) В main.cpp - #include <include/firs_file.h>', 25, '', '2021-01-25 11:04:23'),
